package br.com.readfile;import br.com.readfile.abstracts.ReadFile;import br.com.readfile.abstracts.ReaderExcel;import br.com.readfile.entities.ReadExcel;import br.com.readfile.entities.User;import br.com.readfile.entities.WorkMap;import br.com.readfile.imp.FastExcelReaderImp;import java.util.List;public class Main {  public static void main(String[] args) throws Exception {    ReaderExcel reader = new FastExcelReaderImp();    WorkMap workMap = new WorkMap();    workMap.put("id", "id");    workMap.put("titulo", "title");    workMap.put("author", "name");    ReadFile readFile = new ReadExcel(User.class, workMap, reader);    String filePath = "src/main/resources/Example.xlsx";    List<User> user = readFile.read(filePath);    for(var u : user) {      u.show();    }  }}